const TimePicker = ({ selectedTime, onChange }) => {
    const timeOptions = [];
    for (let hour = 9; hour <= 18; hour++) {
        timeOptions.push(`${hour}:00`, `${hour}:30`);
    }

    return (
        <select
            value={selectedTime}
            onChange={onChange}
            className="px-4 py-2 border rounded-md focus:ring-2 focus:ring-green-500"
        >
            <option value="">SelecteazÄƒ ora</option>
            {timeOptions.map((time, index) => (
                <option key={index} value={time}>{time}</option>
            ))}
        </select>
    );
};
